本体/IPバスケーブル/電源コネクター <br>

IPバスを用いてiPod&reg;とのリンクを実現。タイトルを始めとした楽曲データがメインユニ<br>ットに表示されるとともに、プレイリストや曲の選択、ジャンル/アーティスト/ア<br>ルバムによる曲の絞込みは、すべてメインユニットから操作できます。 バッテリー<br>チャージ機能搭載により、バッテリー残量を気にすることなくロングプレイを楽し<br>めます。<br>

